Episode 5 tonight|I love you. Halfway there♥️|Photo shared by Zendaya on January 24, 2022 tagging @luxurylaw, @kimblehaircare, @raoulalejandre, @lancomeofficial, and @abdmstudio.|Photo shared by Zendaya on January 23, 2022 tagging @likethejetsons, @hunterschafer, and @euphoria.|Photo shared by Zendaya on January 16, 2022 tagging @likethejetsons, @hbo, @a24, @euphoria, and @streamonmax.|This news just breaks my heart. To speak about her as if she’s not with us feels strange as she is so incredibly full of life. There’s not a time I saw her without her iconic red lips and full teased hair, a true rockstar through and through. Ronnie, being able to know you has been one of the greatest honors of my life. Thank you for sharing your life with me, I could listen to your stories for hours and hours. Thank you for your unmeasured talent, your unwavering love for performing, your strength, resilience and your grace. There is absolutely nothing that could dim the light you cast. I admire you so much and am so grateful for the bond we share. You are a magical force of greatness and the world of music will never be the same. I wish everyone got to experience you the way I did. We celebrate your beautiful life and give you all the flowers you so rightfully deserve. Rest in great power Ronnie. I hope to make you proud.|A reminder before tonight…|Photo shared by Zendaya on January 07, 2022 tagging @luxurylaw, @maisonvalentino, @kimblehaircare, @bulgari, @djeneba.aduayom, @lancomeofficial, and @euphoria.|Photo by Zendaya on December 27, 2021.|I know it’s been a long time, but we’ll see you January 9th

